Mud Men

History Documentary hosted by Johnny Vaughan and Steve Brooker, published by History Channel in 2011 - English narration


Information
------------------------------

Mud Men with Johnny Vaughan
This guerrilla archaeology series, starring Johnny Vaughan with his guide Mud God Mudlarker Steve Brooker, reveals the astonishing mud-covered, hidden history of London. Vaughan and Brooker are on an adventure, digging up the banks of the Thames to reveal a unique and original perspective on London s rich history. Armed with metal detectors and shovels the pair have just five hours before the tide rushes in to wade, search and dig the banks of the River Thames finding artefacts, from jewelled daggers to slave manacles, medieval tiles to cursed Bellarmine pots, which lead them on a quest


1)  Guns 
Johnny Vaughan and Steve Brooker hit gold on day one, as they mudlark on the holy grail of Thames foreshores at the Tower of London. While Steve investigates the military origins of a mysterious golden trumpet, Johnny re-unites a 250 year old musket ball with the Brown Bess gun that fired it. Together the boys go ballistic as they head to the firing range and try out the guns that have shaped 200 years of British Military history.



